import { useEffect } from "react";
import AuthUser from './AuthUser';
import { Navigate } from "react-router-dom";

export default function Home() {
    const { fetchUsers, users } = AuthUser();

  useEffect(() => {
    fetchUsers();
  }, []);

  const {getToken} = AuthUser();
  if(!getToken()){
    Navigate('/login')
  }
  return (
    Navigate('/dashboard')
  );
}
